contracts/Armazenamento.sol.content:
// SPDX-License-Identifier: GPL-3.0

pragma solidity >=0.8.2 <0.9.0;

import "./ArmazenamentoInterface.sol";
import "./ControleAcessoDono.sol";

contract Armazenamento is ArmazenamentoInterface, ControleAcessoDono {
    string armazenado = "";

    function guardar(string memory texto) public apenasDono {
        armazenado = texto;
    }

    function recuperar() public view returns (string memory) {
        return armazenado;
    }
}

contracts/ControleAcessoDono.sol.content:
// SPDX-License-Identifier: GPL-3.0

pragma solidity >=0.8.2 <0.9.0;

abstract contract ControleAcessoDono {
    address dono;

    constructor() {
        dono = msg.sender;
    }

    modifier apenasDono() {
        require(msg.sender == dono, "Apenas o dono pode chamar esta funcao");
        _;
    }
}

